import React from 'react';
import logo from './logo.svg';
import './App.css';
import './tailwind_styles.css'
import 'antd/dist/antd.css';

import {Upload, Button, Icon} from 'antd'

function App() {
  return (
    <>
      <div className="text-justify w-full teal-100">
        <h1 className="text-4xl self-center font-bold bg-blue-400 py-2">ScaleRes.</h1>
      </div>

      <div className="px-64 pt-12">
        <p className="text-base">Enter an image you'd like you scale up.</p>
        <Upload>
          <Button>
            <Icon type="upload" /> Upload
          </Button>
        </Upload>
      </div>
    </>
  );
}

export default App;
